ime.datetime(2021, 5, 26, 18, 6, 27, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 640012632, 'comment_body': 'Agreed, I used https://lab.mlpack.org/ entered your fork and branch to run it, worked pretty well, except that the optimization step took a really long time.', 'comment_created': datetime.datetime(2021, 5, 26, 18, 14, 3, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}, {'comment_id': 640473684, 'comment_body': 'Reg. our results, I do find it kinda odd for the results to be this slow in xeus-cling, my mid-tier laptop can knock it off within seconds. Also, I'm worried about the diversity of the solution, if you recall one of the goals of MOEA is to have a uniform distribution of solutions, what's happening in our algorithm is producing a "cluster" of solutions.

Arguably, since each of the clusters is far apart the solution set is indeed "diverse" so we can't really blame the algorithm. I'm not sure if NSGA-II is to blame or whether our implementation is wrong. It's also possible that our population size is too low to observe the actual Pareto Front but I'm not going to let our users wait an eternity for that.', 'comment_created': datetime.datetime(2021, 5, 27, 9, 54, 6, tzinfo=datetime.timezone.utc), 'commenter': 'jonpsy', 'type': 'User'}, {'comment_id': 640717132, 'comment_body': 'Yeah, seems odd to me, we should run some more experiments with different parameters. But I think for now this is good, the solution is still valid.', 'comment_created': datetime.datetime(2021, 5, 27, 15, 8, 59, tzinfo=datetime.timezone.utc), 'commenter': 'zoq', 'type': 'User'}]

